signatures: >-
  executeAgentCommand(agentDirectoryPath:string, command:string) :
  Promise.<string> - Executes a faqtiv cli command in the specified agent
  directory and returns a promise that resolves with the command's stdout
  output. If stdout is empty and stderr is non-empty, it resolves with stderr.
  If the command fails, it rejects with an error containing stderr or an error
  message.
